import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home'
import {  Routes, BrowserRouter, Route}
from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div clasName="app">
        <Route>
          <Header />
          <Home />
        </Route>

      </div>
    </BrowserRouter>
  );
}

export default App;
